import React, { useState } from 'react';

import './CadEstabelecimento.css';

import api from '../../services/api';

function valoresIniciais() {
    return {
        nome: '',
        cnpj: '',
        endereco: '',
        numero: '',
        latitude: '',
        longitude: '',
        tipoEstabelecimento: '',
        senha: '',
    };
}

async function getIdEstabelecimento() {

}

export default function CadEstabelecimento() {
    const [valores, setValores] = useState(valoresIniciais);

    function handleChange(event) {
        const { name, value } = event.target;
        setValores({ ...valores, [name]: value });
    }

    async function handleCadastrar() {
        // const payload = {
        //     "Nome": valores.nome,
        //     "Cnpj": valores.cnpj,
        //     "Endereco": valores.endereco,
        //     "Numero": valores.numero,
        //     "Latitude": valores.latitude,
        //     "Longitude": valores.longitude,
        //     "IdTipoEstabelecimento": valores.tipoEstabelecimento,
        //     "Imagem": "/uploads/default.png",
        //     "Distancia_km": "0",
        //     "Senha": valores.senha
        // }

        // try {
        //     const resposta = await api.post('/estabelecimento', payload);
        //     console.log({ resposta });
        // } catch (err) {
        //     console.log({ err });
        // }

        console.log(valores);

    }

    return (
        <div>
            <section className="testimonial py-5" id="testimonial">
                <div className="container">
                    <div className="row ">
                        <div className="col-md-4 py-5 bg-primary text-white text-center ">
                            <div className=" ">
                                <div className="card-body">
                                    <img src="http://www.ansonika.com/mavia/img/registration_bg.svg" style={{ width: '30%' }} />
                                    <h2 className="py-3">Cadastro de estabelecimento</h2>
                                    <p>Tation argumentum et usu, dicit viderer evertitur te has. Eu dictas concludaturque usu, facete detracto patrioque an per, lucilius pertinacia eu vel.
                                </p>
                                </div>
                            </div>
                        </div>

                        <div className="col-md-8 py-5 border">
                            <h4 className="pb-4">Insira os dados do seu estabelecimento</h4>

                            <form autoComplete="off">

                                <div className="form-row">
                                    <div className="form-group col-md-12">
                                        <input
                                            id="nomeEstabelecimento"
                                            name="nomeEstabelecimento"
                                            placeholder="Nome do estabelecimento"
                                            className="form-control"
                                            type="text"
                                            onChange={handleChange}
                                        />
                                    </div>
                                </div>

                                <div className="form-row">
                                    <div className="form-group col-md-10">
                                        <input
                                            id="enderecoEstabelecimento"
                                            name="enderecoEstabelecimento"
                                            placeholder="Endereço do estabelecimento"
                                            className="form-control"
                                            type="text"
                                            onChange={handleChange}
                                        />
                                    </div>

                                    <div className="form-group col-md-2">
                                        <input
                                            id="numeroEstabelecimento"
                                            name="numeroEstabelecimento"
                                            placeholder="Nº"
                                            className="form-control"
                                            type="number"
                                            onChange={handleChange}
                                        />
                                    </div>
                                </div>

                                <div className="form-row">
                                    <div className="form-group col-md-6">
                                        <input type="cnpj" className="form-control" id="inputCnpj" placeholder="CNPJ" />
                                    </div>

                                    <div className="form-group col-md-6">
                                        <select
                                            id="tipoEstabelecimento"
                                            className="form-control"
                                            onChange={handleChange}
                                        >
                                            <option value={0}>Tipo de estabelecimento</option>
                                            <option value={1}>Bar</option>
                                            <option value={2}>Restaurante</option>
                                            <option value={3}>Lanchonete</option>
                                        </select>
                                    </div>
                                </div>

                                <div className="form-row">
                                    <div className="form-group  col-md-6">
                                        <input
                                            type="text"
                                            className="form-control"
                                            id="latitudeEstabelecimento"
                                            placeholder="Latitude"
                                            name="latitudeEstabelecimento"
                                            onChange={handleChange}
                                        />
                                    </div>

                                    <div className="form-group  col-md-6">
                                        <input
                                            type="text"
                                            className="form-control"
                                            id="longitudeEstabelecimento"
                                            placeholder="Longitude"
                                            name="longitudeEstabelecimento"
                                            onChange={handleChange}
                                        />
                                    </div>
                                </div>

                                <div className="form-row">
                                    <div className="form-group  col-md-12">
                                        <input
                                            type="password"
                                            className="form-control"
                                            id="senhaEstabelecimento"
                                            placeholder="Senha"
                                            name="senhaEstabelecimento"
                                            onChange={handleChange}
                                        />
                                    </div>
                                </div>

                                <div className="form-row">
                                    <div className="form-group col-md-12">
                                        <div className="form-group">
                                            <div className="form-check">
                                                <input className="form-check-input" type="checkbox" defaultValue id="aceitaTermos" required checked={valores.aceitaTermos} />
                                                <label className="form-check-label" htmlFor="invalidCheck2">
                                                    <small>Aceito os termos de condições de uso.</small>
                                                </label>
                                            </div>
                                        </div>
                                    </div>
                                </div>

                                <div className="form-row">
                                    <div className="form-group col-md-12">
                                        <button type="button" className="btn btn-dark btn-lg" onClick={handleCadastrar}>Cadastrar</button>
                                    </div>
                                </div>

                            </form>
                        </div>
                    </div>
                </div>
            </section>
        </div>
    );
}
